// 現在のページを取得する。
var page = Forguncy.Page;
// 現在のページでatesakiという名前のセルを取得する。
var atesakicell = page.getCell("atesaki111");
// getValueメソッドでatesakiセルの値を取得する。
var atesakicellValue = atesakicell.getValue();
// 宛先を配列にする
var atesakiitem = atesakicellValue.split(',');
//　配列に含まれる重複を削除
var atesakiitem1 = new Set(atesakiitem);
// 現在のページでatesakiigaiセルを取得する。
//var ateigaicell = page.getCell("uuu");
// getValueメソッドでatesakiigaiセルの値を取得する。
//var ateigaiValue = ateigaicell.getValue();
// 現在のページでnippouIDセルを取得する。
var nidcell = page.getCell("nippouID");
// getValueメソッドでmidセルの値を取得する。
var nidcellValue = nidcell.getValue();
// 現在のページでユーザーセルを取得する。
var toukousyacell = page.getCell("ユーザー");
// getValueメソッドでuserセルの値を取得する。
var toukousyacellValue = toukousyacell.getValue();


atesaki = [];


// atesakiitem1の配列の数を繰り返して、オブジェクトを作成
for ( var ate of atesakiitem1) { 
 atesaki.push(
	{
		宛先ユーザー: ate,
		日報chatID: nidcellValue,
		宛先メンバー: true,
		差出人: toukousyacellValue,
		区分: "1",
		既読状態: "false",
		コメント既読状態: "true",
	});
}




Forguncy.Page.getCell("atesaki_obj2").setValue(atesaki);

// 現在のページを取得する。
var page = Forguncy.Page;
// 現在のページでatesakiという名前のセルを取得する。
var ateobjcell = page.getCell("atesaki_obj2");
// getValueメソッドでatesakiセルの値を取得する。
var ateobjcellValue = ateobjcell.getValue();

// 1回のpostリクエストを送信して、サーバーサイドでテーブルを追加・

var postUrl = "http://localhost:37998/customapi/modifytablesdatademo/modifytablesdata";

// サーバーサイドAPIの「IDataAccess.ModifyTablesData メソッドで使用するModifyDataのデータを準備します。
var modifyData = {};

modifyData.日報chat_未読既読= {};

// 追加
modifyData.日報chat_未読既読.AddRows = ateobjcellValue;

// post
$.post(postUrl, JSON.stringify(modifyData), function () {
});
